import React from 'react';

export default class Account extends React.Component{

    #IsMyAccount
    #AccountName

    constructor(login){
        super(login);
        if(login === localStorage.getItem('account')){
            this.IsMyAccount = true;
        }else{
            this.IsMyAccount = false;
        }
        this.state = {data: []}
        this.#AccountName = login;
    }

    #getAccount = async () => {
        try {
            const res = await fetch(`http://localhost:4000/search/8`);
            const jsonData = await res.json();
            this.setState({data: jsonData});
        } catch (error) {
            console.error('Error fetching data:', error);
        }
        fetch("http://localhost:4000/search/8")
        .then(res => {res.json()})
        .then(
            (result) => {
                this.setState({jsonData: result})
            }
        )
        const dataArr = Object.values(this.state.jsonData);
        return dataArr;
    }

    getAccountMainInformation(){
        const data = this.#getAccount();
        return(<form>
            <a>{this.#IsMyAccount}</a>
            <table>
            <thead>
                <tr>
                    <th>
                        Account
                    </th>
                    <th>
                        Password
                    </th>
                </tr>
            </thead>
            <tbody>
                {data.map(el => (
                    <tr>
                        <td>{el.account_name}</td>
                        <td>{el.account_password}</td>
                    </tr>
                ))}
            </tbody>
        </table>
        </form>);
    }
}
